import React from 'react'
import '../../Style/SearchBar.css'

function SearchBar() {
    return (
        <>
            <div className='searchbar-container'>
                <input className='searchbar-search'/>
                <button className='searchbar-button'>Search</button>
            </div>
        </>
    )
}

export default SearchBar
